<script>
import AbbreviateNumber from 'src/components/AbbreviateNumber.vue'
export default {
    components: {
        AbbreviateNumber
    },
    props: {

    },
    computed: {

    },
    data() {
        return {
            isOpen: null,
            dialogObj:{
                title: "Woohoo", 
                subtitle: null,
                value: 0, 
                currency:  null,
                time: 5000,
                closeFunc: null,
            }
        }
    },
    methods:{
        openDialog(dialogObj){
            this.dialogObj = Object.assign(this.dialogObj, dialogObj);
                setTimeout(() => {
                      this.isOpen = true;
                      if(this.dialogObj.time){
                            setTimeout(() => {
                                    this.isOpen = false;
                            }, this.dialogObj.time);
                      }
                }, 1500);
        }
    },
    watch: {
        isOpen: {
            handler: function(val, oldVal) {
                if(/*!this.dialogObj.time &&*/ this.dialogObj.closeFunc && val===false){
                        this.dialogObj.closeFunc();
                }
            },
        },
    }
}
</script>
